import React from 'react';
import '../css/Main.css'
import 'bootstrap/dist/css/bootstrap.css';
import {Redirect, Route, NavLink} from 'react-router-dom';


function Login(){
    return(
        <div className="MainButtons">
        <header>
            <nav >
                <ul className="LinkElements">
                    <li>< NavLink className="mainLink" to={{
                        pathname: '/homeP'
                    }}>Home</ NavLink></li>

                </ul>
            </nav>
        </header>
        </div>

    );
}
